        required_chars = len(t_count)
        left = 0
        min_length = float('inf')
        min_start = 0
        for right in range(len(s)):
            if s[right] in t_count:
                t_count[s[right]] -= 1
                if t_count[s[right]] == 0:
                    required_chars -= 1
            while required_chars == 0:
