                    min_length = right - left + 1
                    min_start = left
                if s[left] in t_count:
                    t_count[s[left]] += 1
                    if t_count[s[left]] > 0:
                        required_chars += 1
                left += 1
        return "" if min_length == float('inf') else s[min_start:min_start + min_length]

